description:
Die (2010)

Six people, each one of them on the road to self-destruction, wake up in cells in surreal surroundings, without knowing how they got there or why. Are they mad? What happened? As they try to figure out things, a mysterious man forces the six to participate in a disturbing experiment called 'The Trials'. As the experiment is proceeding, the unwilling participants face disturbing truths about themselves, while others decide on their fates in a nerveracking game of dice. To find out that there is a connection between them...


